const Hello = () => (
  <div>
    <p>Hell</p>
  </div>
)


const App = () => {
  console.log('Hello from component')
  const now = new Date()
  return(
  <div>
    <p>Hello world. The time is {now.toString()}</p>
  </div>
)
}

export default App
